import React from "react";

const SearchClubs = props => (
  <div>
      <h1>Search All Clubs</h1>
      <p> input for key words</p>
      <p> searches by titles / author /genre</p>
      <p> Carosal for all information on clubs</p>
      <p> Card with Name of Club & Image of the Book</p>
      <p> Book and Author</p>
      <p> Start Date</p>
  </div>
);

export default SearchClubs;
